y blow. Let him pay more attention to it next term.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2118829\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Casmir, you really tried but you can arise above the average. Try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very good result for a beginner. He can do better if he adds more effort next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2155681\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"David, while struggling to pass the core subjects also pay attention to other subjects. Just know it that this is not your best that you can rise above average. Try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fair result for a beginner. Put in more effort next term and you will smile home with a better result.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2175491\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Christopher, you really tried but try harder next term. pay attention to your french language and know it that this is not your best you can rise above the average.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result for a beginner. It is obvious he can do better if he so desires.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2196618\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Victor, you really made me proud keep it up but know it that you can rise above average. Try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very very good result. You have really started very well. Ensure you don\'t lose focus. Although his result is good, but he can be unserious sometimes.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2188367\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Jude, nice result keep it up am really proud of you but you can rise above the average try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result, but spoilt by mathematics a compulsory subject. If others can pass mathematics, he can pass it as well. Let him pay more attention to it next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2127797\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Emmanuel, nice result keep it up but you still have a long way to go. Try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result, but spoilt by Latin which is a compulsory subject. If others can pass Latin, you can as well pass it. Pay more attention to it next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2184464\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Anthony, nice result you really made me proud keep it up .But know it that you can rise above the average. \\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result for a beginner. Make it better next term because I believe you can do better.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2192576\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Charles, you really tried but try harder next term. know it that you can rise above the average. Keep it up. \\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result for a beginner. Make it better next term because I believe you have what it takes to do better.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2153061\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Kelvin, you tried but this is not what i expected from you. know it that you can rise above the average. Try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result, although I expected something better from you as a repeater. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2171641\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Chibuikem, you tried but keep it up. know it you can rise above the average. Try harder next term. \\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very good result for a beginner. You have really started well and I believe you will not lose focus.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2183162\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Michael, while struggling to pass the core subjects also pay attention to other subjects and know it that you can rise above the average. You tried keep it up.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A poor result. You failed two compulsory subjects and two others. You are almost an elder in that class and I expect something better from you. Challenge yourself next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2136436\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Canice, this is a poor result and you normally sleep during night studies. Try to take your siesta and work harder next term because you have a very long way to go.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"You have simply wasted your parents\' limited resources this term. Wake up from your intellectual slumber before all your mates overtake you.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2140296\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Dominic, you really tried but while struggling to pass the core subjects also pay attention to other subject. keep it up and try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fair result for a beginner, but spoilt by mathematics which is a compulsory subject. If others can pass mathematics, he can as well. All he needs is a little more push.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2146739\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Patrick, you tried but this is not your best you still have a long way to go. just know it that you can rise above the average if you work harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Your result is generally poor, but you could have stolen a pass if not that Latin which is a compulsory subject gave you the final blow. Anyway, all hope is not lost. Work harder next term and smile home with a better result.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2176249\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Emmanuel, this is a poor result try harder next term. You worked below your capability know it that you can rise above the average if you work hard next term.\\\"]\",\"2\":\"\"},\"SJBSI2112783\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Stephen, you tried but while struggling to pass the core subjects also pay attention to other subjects. know it that you can rise the average if you work hard next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Your result is generally bad, but you could have stolen a pass if not that mathematics which is a compulsory subject, gave you a heavy blow. Anyway, all hope is not lost. Just pay more attention to it next term and work harder for an overall improvement.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2146268\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Michael, you really tried but while struggling to pass the core subjects also pay attention to other subjects. just know it that you can perform better if you work hard next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A manageable result for a beginner although spoilt completely by Latin which is a compulsory subject. Pay more attention to Latin next term and work harder for an overall improvement.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2185598\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Victor, you really tried but while struggling to pass the core subjects also pay attention to other subjects. keep it up but know it that you can perform better if you work harder next term. Then try to take your siesta because you sleep a lot during every studies work on your self. \\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result for a beginner. Believe that you can do better and you will marvel at what you will bring to the table next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2178141\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Paschal, excellent result you really made me proud am happy for you but try to keep the pace never give up. You can rise above the average if you work harder next term. To whom much is given much is expected.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"An EXCELLENT result. You have really started very well academically and once you remain focused then the sky will be just the beginning of the height you will attain academically. Keep it up.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2163310\":{\"1\":\"[\\\"Mr. Chukwubuikem Johnpaschal\\\",\\\"Franklin, you really tried am proud of you but try harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very very good result. You have really started well. Your result should challenge you to work harder. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"}},\"thenotg\":\"1. The seminary reopens for second term on January 8, 2022\\r\\n2. Feast day celebration comes up on February 12, 2022\\r\\n3. Second term school fees is #50,000\\r\\n\"}', 0, '2021/2022', '2022');
