s completely destroyed by mathematics. If others can pass mathematics, he can as well. Sit up and justify your school fees. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2190077\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"This is a nice result, but you still lack concentration during studies. Try to work on that for a better result next term. \\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Although you passed very well generally speaking, but your score in Latin is still low. Challenge yourself and pass it with distinction next term.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2146123\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A fair result,Paschal,if you pay serious attention to your studies,i believe you can do more.You are a smart boy and capable of doing more than this\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fairly good result.  I don\'t know what is so difficult in Literature-in-English that you should allow it spoil your result.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2116212\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"A very excellent result. Raphael is a very hardworking and serious minded seminarian, I hope you will not relax and try to maintain the standard.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Passing all your subjects in distinction is clear sign of high intellectual stability. Remain focused and keep making your parents and benefactors proud. A super result indeed.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2159571\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"Victor is a brilliant boy, but have a problem of sleeping a lot during studies.If you pay more attention to your studies,you do more than this\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"He seems to have accepted the complete defeat of Latin over him. The earlier he faces Latin squarely and conquers it, the better for him.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2174637\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A fair result,Michael, put more effort when studying,you are capable of doing more than this.keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fairly good result, but was spoilt by Latin which is a compulsory subject. Pay more attention to Latin next term before it destroys things for you.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2189986\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A wonderful performance..keep it up Emmanuel,i am proud of you ,i believe you can do more than this.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very nice result. Is obvious you can do better. Take a breath and push harder and never relent until you get to the peak.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2102728\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"Good result. Francis, you tried this term but you still need to improve for a better result next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result. Make it better next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2184665\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"Emmanuel, more effort is still needed for a better performance. You need to sit up. Try harder.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Though your result is generally fair, but mathematics which is a compulsory subject spoilt it. If others can pass it, you can as well. Just pay more attention to it next term without neglecting others. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2157603\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"This is not a good result. You still lack concentration during studies, try to work on that for a better performance next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A manageable result. There is very big need for improvement.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2116426\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A good result...Justin is a cheerful seminarian but usually get distracted by any slightest opportunity, you are capable of doing more..keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Latin is no longer a narrow escape this time around and I believe you are happy. Don\'t relent. A good result. He is always lively. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2191114\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"A nice result, you are always serious with your studies and very hardworking. Continue to improve.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"You have really proved that sickness during exam was the reason behind your poor performance last term. Keep soaring higher because I believe you do better. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2146677\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"Nice result. Justin you need to study hard in order to improve on this result. keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"It is very dicey being at the center of the road. You are at the center of your class and I pray you don\'t go back from there, but rather front. Next term will tell.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2162369\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"This is not so bad but you are still distracted in the class, try to work on that for a better performance.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Why would you fail two compulsory subjects? If others can pass them, then you can as well. All you need is to give them more time next term and not to be afraid of them. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2197965\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"Good result but more effort is still needed. Try to be focus and avoid unnecessary distraction. Try harder.\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"A good result. Make it better next term.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2173885\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"Good result but you still need to improve for a better result next term. Try harder.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A good result. Challenge yourself a little more and smile home with a better result next term.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2197128\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A good result,Emmanuel,i believe that you can do more than this just put a little effort....in all,he is a good seminarian and always ready to learn..keep it up,i am proud of you\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very good result. Make it better next for I believe you have the capacity. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2173045\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"a fair result. there is still room for improvement\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"Latin was your waterloo last term and this time around mathematics has joined, thus you failed two compulsory subjects and two others. Wake up from your intellectual slumber and justify your school fees.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2121859\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"a nice result.keep it up do not relent,you can perform more than this\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very very good result. Make sure you don\'t relent. Kyrian is always very calm, recollected and accountable. He is also a good singer.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2180559\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"Nice result. He is docile to formation and always takes his studies seriously.Just put more effort,you are capable of doing more..\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fair result with much room for improvement. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2129669\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A nice result,keep it up. FrankPaul is a talented and smart boy....put more effort and you will achieve great heights\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\" A good result. Keep making effort to advance further. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2138425\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"Poor performance,Albert you can do more than this if you pay attention to your studies and reduce the rate at which you play when not required,it distracts you.\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"You did not really justify the school fees that your parents paid for you. Failing two compulsory subjects and additional one is not a sign that you are serious minded academically. Better sit up before it is too late. Of course you should know that you were promoted on trial. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2144979\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"Fair result...work harder next term.\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"Latin has cost you this term. Why? If others can pass Latin, then you can as well. Believe in yourself and see what becomes of your result next term. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2185190\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"A very poor result ...you have to sit up and study harder Johnbosco.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Your result is extremely poor. In short, you have wasted your parents\' resources this term. Wake up from your academic slumber before it is too late. JohnBosco is a very calm guy, but he also needs to be more agile and lively.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2186225\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"A poor result...you have to work harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A poor result that was completely destroyed by Latin which is a compulsory subject. Why can\'t you challenge yourself and put a full to the menace of Latin in our academic life. He is a good comedian and is always very lively.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2111338\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A fair result. Pedro is encouraged to pay serious attention to his studies and put more effort.I strongly believe that you are capable of doing more than this..He is a good boy and always ready to learn\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"A manageable result; at least he managed to steal a pass. Thank God and sit up. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2118869\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"Fair result...keep on trying harder!\\\"]\",\"2\":\"[\\\"Promoted on trial\\\",\\\"Mathematics has continued to mesmerize you and you seem to have accepted the fact that it has defeated you. Challenge yourself and face it squarely before it costs you your vocation. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2164998\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"Wonderful result...strive to be the best next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A scintillating performance indeed. You are intellectually stable. Make sure you don\'t lose focus.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2178453\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A wonderful result,keep on making progress Collins,i am proud of you....keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very very  good result. You have really justified your school fees this term.  \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2116430\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"good result...keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"An excellent result indeed. Keep making your parents and benefactors proud. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2154360\":{\"1\":\"[\\\"Mr. Kelvin Akpamgbo\\\",\\\"A nice result. He can do better if he puts more effort in his studies. keep it up\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"What is happening to your academic life? English Language was your problem last term, and it is mathematics this time around. Better face these compulsory subjects squarely otherwise they will keep spoiling things for you.   \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2135719\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"A nice result,keep it on improving and making progress.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A very good result. He is always neat and sings very well, but should be advised to be more careful with his personal belongings.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2179518\":{\"1\":\"[\\\"Mr. Chima Nichodemus.\\\",\\\"Charles, try to concentrate during studies, you always distract yourself while in the class. If you can work on that, I believe you will improve because you have the capability. Try harder.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"A fair result. I wonder what is so difficult in Literature-in-English. Bring something better to the table next term. \\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"},\"SJBSI2124037\":{\"1\":\"[\\\"Chima Nichodemus\\\",\\\"Very poor result Benedict...better sit up and face what is facing you, you need to work harder next term.\\\"]\",\"2\":\"[\\\"Promoted\\\",\\\"Failing two compulsory subjects and two others, as well as taking the last position in your entire class is a sign that you are sleeping intellectually. Wake up and redeem yourself before it is too late.\\\",\\\"Rev. Fr. Paul-Mary Chukwukebe\\\"]\"}},\"thenotg\":\"1. The seminary reopens for second term on January 8, 2022\\r\\n2. Feast day celebration comes up on February 12, 2022\\r\\n3. Second term school fees is #50,000\\r\\n\"}', 0, '2021/2022', '2022');
